#include<string>
#include<set>
#include<vector>
#include<iostream>
#include<functional>
using namespace std;

class Solution {
public:
    vector<int> findSubstring(string s, vector<string>& words) {
        int word_len = words[0].length();
        vector<int> res;
        multiset<int> original_set;
        hash<string> hash_fun;
        for(int word_idx=0;word_idx<words.size();word_idx++)
        {
            original_set.insert(hash_fun(words[word_idx]));
        }
        multiset<int> temp_set;
        for(int str_idx=0;str_idx<=(s.length()-word_len*words.size());str_idx++)
        {
            for(int word_idx=0;word_idx<words.size();word_idx++)
            {
                if(str_idx + word_idx*word_len >= s.length())break;
                temp_set.insert(hash_fun(s.substr(str_idx+word_idx*word_len,word_len)));
            }
            if(temp_set == original_set)
            {
                res.push_back(str_idx);
            }
            temp_set.clear();
        }
        return res;
    }
};

